.navbar {
  margin: 0 auto;
  max-width: 1200px;
  background: white;
  padding: 1em;

  .container {
    display: flex;
    //place-content: space-between;
    .logo-wrap {
      flex-grow: 2;

      .logo {
        position: relative;
        text-decoration: none;
        font-weight: bold;
        color: black !important;
        font-size: 35px;

        span {
          position: absolute;
          top: -15px;
          color: blue;
        }
      }
    }

    .header_burger {
      display: none;
    }
    @media (max-width: 767px) {
      .header_burger {
        display: block;
        position: relative;
        width: 30px;
        height: 20px;
      }

      .header_burger span{
        position: absolute;
        background-color: black;
        left: 0;
        width: 100%;
        height: 2px;
        top: 9px;
      }
      .header_burger:before,
      .header_burger:after {
        content: '';
        background-color: black;
        position: absolute;
        width: 100%;
        height: 2px;
        left: 0;
      }
      .header_burger:before {
        top: 0;
      }
      .header_burger:after {
        bottom: 0;
      }

      .nav-wrap{
        position: fixed;
        top: 0;
        left: 0;
        width: 100%;
        height: 100%;
        background-color: #3a6397;
        z-index: 3;
      }
    }

    .nav-wrap {
      flex-grow: 1;
      margin-left: 185px;

      nav {
        flex-grow: 1;
        width: 100%;
        display: flex;

        .mobile-exit {
          display: none;
        }

        .mobile-cta {
          display: none;
        }


        ul {
          width: 100%;
          display: flex;
          margin-bottom: 0;

          .ul-wraper {
            width: 100%;
            place-content: space-between;
            justify-content: space-between;
            display: flex;
            padding-top: 11px;
            margin-right: 20px;
          }

          select {
            color: lightslategrey;
            border: 0;
            background: white;
          }

          .get-it-now {
            width: 125px;
            white-space: nowrap;
            padding: 10px;
            border-radius: 6px;
            border: 2px solid blue;
            text-align: center;

            a {
              color: blue;
            }
          }

          a {
            text-decoration: none;
          }
        }

      }
    }
  }
}

