.wrapper {
  display: block;
  margin-bottom: 100px;

  .heder-menu {
    margin-left: 24px;
    margin-right: 24px;
    position: relative;

    .backgrund-up-section {
      min-height: 600px;
    }

    img {
      width: 100%;
      border-radius: 1rem;
      vertical-align: middle;
      border-style: none;
    }

    .on-image {
      position: absolute;
      top: 0;
      right: 0;
      bottom: 0;
      left: 0;
      background-image: linear-gradient(
